package com.zc.double_point.move_window;

import java.util.HashMap;
import java.util.Map;

/**
 * 这里面有两个关键的点
 * 1. 滑动窗口找出最优解
 * 2. 通过双哈希表的方式，在移动的过程中记录match的数量，来判断是否覆盖子串了
 * @author lizhecao 2021/3/15
 * @version 1.0
 */
public class MinimumWindowSubstring76 {
  public String minWindow(String s, String t) {
    //先移动右指针
    //检查窗口是否包含字串
        // 通过双哈希表的方式。将窗口和字串都放入hashmap中，key为字符，value为字符的次数。
        // 每次移动窗口的时候，判断新增的字符是否在字串的hashmap中。如果有，就添加到窗口的hashmap中，次数+1，然后看下次数是否达到子串的次数
        // 如果达成，就将匹配数量加上该次数。那么检查窗口是否包含子串就是检查匹配数量是否为子串的长度即可
    //如果包含移动左指针，同时判断是否更新最小字串
    int l=0,r=0;
    String result="";
    int resultR=Integer.MAX_VALUE, resultL=0;
    int count=0;
    Map<Character, Integer> needs = new HashMap();
    Map<Character, Integer> winMap = new HashMap();
    for (int i = 0; i< t.length();i++) {
      needs.put(t.charAt(i), needs.getOrDefault(t.charAt(i), 0) + 1);
    }
    while (r < s.length()) {
      char rc = s.charAt(r);
      r++;

      if (needs.containsKey(rc)) {
        Integer winCNum = winMap.getOrDefault(rc, 0) + 1;
        winMap.put(rc, winCNum);
        if (winCNum.equals(needs.get(rc))) {
          count += winCNum;
        }
      }

      while (count == t.length()) {
        if (r - l < resultR - resultL) {
          resultR = r ;
          resultL = l;
        }

        char lc = s.charAt(l);
        l++;

        if (needs.containsKey(lc)) {
          Integer winCNum = winMap.get(lc) - 1;
          winMap.put(lc, winCNum);
          if (winCNum == needs.get(lc) - 1) {
            count -= needs.get(lc);
          }
        }
      }

    }


    if (resultR == Integer.MAX_VALUE) {
      return "";
    }
    return s.substring(resultL, resultR);
  }

  public static void main(String[] args) {
    MinimumWindowSubstring76 minimumWindowSubstring76 = new MinimumWindowSubstring76();
    StringBuilder stringBuilder = new StringBuilder();
    stringBuilder.append(
        "");
    stringBuilder.append(
        "");
    System.out.println(minimumWindowSubstring76.minWindow(stringBuilder.toString(),
        ""));
    System.out.println(minimumWindowSubstring76.minWindow("aa", "aa"));
    System.out.println(minimumWindowSubstring76.minWindow("aa", "bc"));
    System.out.println(minimumWindowSubstring76.minWindow("ADOBECODEBANC", "ABC"));
  }
}

